INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "春咲 ひより", 0, 0, 0, 1, "お！\nあそこに困ってそうな人発見！", "ねぇねぇ、騎士クン\n手伝ってあげようよ～", "ヒヨリでっす♪\n元気いっぱいがんばるよ♪", 2, 1001, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "草野 優衣", 0, 0, 0, 1, "大切な人を\n守れるようになりたい…って", "わ、わたし、\nなに言ってるんだろ\nあはは…", "みんなみたいに\nわたしも強くならなきゃ", 2, 1002, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "士条 怜", 0, 0, 0, 1, "キミに必要な集中力と感性が", "少しは磨かれると思いますよ。", "フェンシングを始めてみては？", 2, 1003, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "穂高 みそぎ", 0, 0, 0, 1, "今日はなにして遊ぶ？", "みそぎはねぇ、\nかくれんぼやりたい！", "ねぇ、にいちゃん！", 2, 1004, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "風宮 あかり", 0, 0, 0, 1, "ねぇ…", "私といっしょに…\nいかない？", "風宮あかりです", 2, 1006, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "出雲 宮子", 0, 0, 0, 1, "プリンたべたいのー", "食べ物の恨みは怖いのー", "出雲宮子なのー", 2, 1007, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "虹村 雪", 0, 0, 0, 1, "キミもボクの美貌に\n吸い寄せられたんだね。", "いいよ。\n見られることは運命さ…", "ボクは虹村雪。", 2, 1008, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "柊杏奈", 0, 0, 0, 1, "我が真名は\nアンネローゼ・フォン・シュテッヒパルム！", "人呼んで「疾風の冥姫」!!", "フッ…聞いて後悔するがいい！", 2, 1009, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "姫宮 真歩", 0, 0, 0, 1, "うさぎさん、\n運命の王子はんに巡りあわせてくれて", "ほんまおおきにやわ～♪", "マホマホ王国のプリンセス、\nまほ姫どす", 2, 1010, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "衣之咲 璃乃", 0, 0, 0, 1, "生き別れたお兄ちゃんを探して\n三千世界！", "ここで会ったが\n100年目～！", "衣之咲璃乃です！", 2, 1011, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "柏崎 初音", 0, 0, 0, 1, "ち、超能力って…\n何のことかな～？", "…って、お願い！\n誰にも言わないでおいて～！", "私はハツネ、\n結構強いんだよ。\nきらーん☆", 2, 1012, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "美波 鈴奈", 0, 0, 0, 1, "一応カリスマ読モJKやってまっす！", "ヒデサイまぢ\nGF（グッドフィーリング）～♪", "ちょす！\n美波鈴奈だよ～♪", 2, 1016, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "喜屋武 香織", 0, 0, 0, 1, "東京は遊園地みたいなところさー", "でも、沖縄もとってもいいとこさー", "はいたーい。\n喜屋武香織さー。", 2, 1017, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "支倉 伊緒", 0, 0, 0, 1, "先生って呼ばれるのは\nくすぐったいから", "イオちゃんって呼んでね。", "支倉伊緒です。", 2, 1018, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "茜 ミミ", 0, 0, 0, 1, "あ！/\お兄ちゃ～ん\nまってよ～", "ミミをおいてかないでぇ～", "ふえ…？\nミミ、むずかしいこと\nよくわかんない…", 2, 1020, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "栗林 くるみ", 0, 0, 0, 1, "あの……\nふぇ……", "ふぇぇぇぇぇん……", "あ…あの…えっと…\n栗…林…くるみ…です……", 2, 1021, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "風宮 より", 0, 0, 0, 1, "こんな私に貴重な時間を\n割いていただき、", "なんてありがとうございます！", "風宮よりです。\nあああああ！", 2, 1022, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "北条 綾音", 0, 0, 0, 1, "おにいちゃんどこいくの？\nえ？", "私こっち行きたいー\nね、早く早くー", "私、アヤネ！\nぷうきちと一緒についてってあげるね！", 2, 1023, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "天野 すずめ", 0, 0, 0, 1, "ふ、不束者ですが\nどうぞ末永く…って、", "これて何か違う…\nあああすみません！", "わっ…わっ…私、\n天野すずめといいます！", 2, 1025, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "倉石 恵理子", 0, 0, 0, 1, "あなたは…運命の……\n伴侶……", "離しませんわ………\n絶対に…!!", "……クスクス…私は\n…倉石恵理子……", 2, 1027, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "佐々木 咲恋", 0, 0, 0, 1, "その無駄を省くことができれば、\nもっと余裕のある暮らしができるっ！", "…そうでしょ？？", "佐々木咲恋よ。\nねえ、世の中に無駄なことが\n多すぎると思わない？", 2, 1028, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "桜井 望", 0, 0, 0, 1, "ぇっと…\nキミ、私のこと知らないの?!", "あはは、\n私もまだまだだなぁ～", "桜井望だよ！\nよろしくねっ", 2, 1029, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "ニノン・ジュベール", 0, 0, 0, 1, "初めまして、\n私はニノン・ジュベール申すデス！", "ショーグン、\nワタシと一緒に天下統一デース！", "デケデケデンっ！", 2, 1030, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "上喜 しのぶ", 0, 0, 0, 1, "でもって私の隣にいるのが……\nえ、見えない？", "おかしいですね……", "上喜しのぶです。\n手元のドクロが父です。", 2, 1031, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "野戸まひる", 0, 0, 0, 1, "けんども\nそれには足りないモンが…", "そう、\nオラのボケに突っ込める相方が…！", "目指すはビッグな\nお笑い芸人だっぺ！", 2, 1033, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "綾瀬 ゆかり", 0, 0, 0, 1, "ちょっと緊張しちゃって…", "ちょ\nちょっと一杯飲んできます…！", "あの…私…綾瀬ゆかりです…\nあの…ごめんなさい！", 2, 1034, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "氷川 鏡華", 0, 0, 0, 1, "知らない人とは話しちゃいけないので", "これ以上お話しすることは…\nないです！", "氷川鏡華…です", 2, 1036, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "柏崎 栞", 0, 0, 0, 1, "……あ、アラーム。", "私体が弱いから、\n30分に一度休憩しないと\nいけないんです。", "柏崎…栞です。", 2, 1038, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "双葉 碧", 0, 0, 0, 1, "私、一人も友達がいなくて……", "野に咲く花が、\n唯一の話相手です。", "ふ、双葉碧です。", 2, 1040, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "三角 千歌", 0, 0, 0, 1, "私の歌声で、\n皆さんが幸せになってくれたらいいなって…", "そう思っています。", "三角千歌です。", 2, 1042, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "安芸 真琴", 0, 0, 0, 1, "あぁ？\nお前のそいつの仲間か？", "う、疑ってすまなかったな…", "安芸真琴だ。", 2, 1043, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "イリヤ・オーンスタイン", 0, 0, 0, 1, "生けとし生ける全ての者よ！", "わらわの偉大な力に\nひれ伏すがいい！\nはっはっは！", "わらわこそは夜を総べる者！", 2, 1044, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "遠見 空花", 0, 0, 0, 1, "ぐふふふふ……はっ！", "ｌク、クウカに何かご用ですか!?", "そこで騎士は妖精を乱暴に……", 2, 1045, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "宮坂たまき", 0, 0, 0, 1, "自由気ままで♪\n寝て遊んで、食べてケンカして…", "う～ん…\n猫ってホントに最高にゃ～♪", "宮坂たまきにゃ♪\n猫はいいにゃよ？", 2, 1046, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "大神 美冬", 0, 0, 0, 1, "それでは早速クエストに…", "…と思ったら\nバイトの時間だ！\nまたあとでね！", "大神美冬よ！", 2, 1048, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "星野静流", 0, 0, 0, 1, "クエストもバトルも\n掃除も洗濯も", "お姉ちゃんがぜ～んぶ\nやってあげるからね！", "星野静流だよ！", 2, 1049, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "玉泉美咲", 0, 0, 0, 1, "見ての通りの\nセクシー美少女で", "学校では誰もが憧れる\nアイドル的な存在ってやつよ♪", "アタシは玉泉美咲。", 2, 1050, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "リマ", 0, 0, 0, 1, "？？？？", "？？？？", "？？？", 2, 1052, 1, 0, 1, 1.4);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "モニカ・ヴァイスヴィント", 0, 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, 1053, 1, 0, 1, 1.5);
