INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "コッコロ", 0, 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, 1059, 1, 0, 1, 1.5);
INSERT INTO `v1_1af99c2b155dc6ae73392b7bbe11d71a6ede631b13dfa6a8418b8d73dacb0aff` VALUES (0, "キャル", 0, 0, 0, 1, "菓子でつろうなどと\n稚拙な策を……", "そ、そこまでいうなら\nもらってやる", "モニカ・ヴァイスヴィントだ。", 2, 1060, 1, 0, 1, 1.5);
